let currentImage = null;
let imageWidth = 0;
let imageHeight = 0;
let isPuzzleCompleted = false;
let originalPositions = [];
let originalImageName = null;

let shuffledIndices = [];
let currentImageIndex = -1;

function shuffleArray(array) {
    for (let i = array.length - 1; i > 0; i--) {
        const j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
    return array;
}

function initializeImageList() {
    if (shuffledIndices.length === 0) {
        shuffledIndices = shuffleArray([...Array(imageLinks.length).keys()]);
        currentImageIndex = -1;
    }
}

function getNextImage() {
    initializeImageList();
    currentImageIndex = (currentImageIndex + 1) % shuffledIndices.length;
    return imageLinks[shuffledIndices[currentImageIndex]];
}

async function loadNextImage() {
    console.log('Loading next image');
    const imageUrl = getNextImage();
    originalImageName = `puzzle_${currentImageIndex + 1}.webp`;
    isPuzzleCompleted = false;
    originalPositions = [];
    loadingIndicator.style.display = 'block';

    try {
        const response = await fetch(imageUrl, {
            mode: 'cors',
            credentials: 'omit'
        });
        if (!response.ok) throw new Error(`HTTP error! status: ${response.status}`);

        const blob = await response.blob();
        currentImage = URL.createObjectURL(blob);

        const img = new Image();
        img.src = currentImage;
        await new Promise((resolve, reject) => {
            img.onload = () => {
                imageWidth = img.width;
                imageHeight = img.height;
                resolve();
            };
            img.onerror = () => {
                console.warn(`Image not found or failed to load: ${imageUrl}`);
                reject(new Error('Image load failed'));
            };
        });

        loadingIndicator.style.display = 'none';
        startPuzzle();
    } catch (error) {
        console.error('Error loading image:', error);
        loadingIndicator.style.display = 'none';
        loadNextImage();
    }
}

function startPuzzle() {
    puzzleContainer.innerHTML = '';
    if (!currentImage) return;

    const aspectRatio = imageWidth / imageHeight;
    let gridCols, gridRows;

    if (PUZZLE_PIECES === 12) {
        gridCols = 4;
        gridRows = 3;
    } else if (PUZZLE_PIECES === 18) {
        gridCols = 6;
        gridRows = 3;
    } else if (PUZZLE_PIECES === 24) {
        gridCols = 6;
        gridRows = 4;
    }

    const pieceWidth = imageWidth / gridCols;
    const pieceHeight = imageHeight / gridRows;
    const maxWidth = window.innerWidth * 0.8;
    const maxHeight = window.innerHeight * 0.8;
    const scale = Math.min(maxWidth / (pieceWidth * gridCols), maxHeight / (pieceHeight * gridRows), 1);

    puzzleContainer.style.gridTemplateColumns = `repeat(${gridCols}, ${pieceWidth * scale}px)`;
    puzzleContainer.style.gridTemplateRows = `repeat(${gridRows}, ${pieceHeight * scale}px)`;

    const pieces = [];
    for (let y = 0; y < gridRows; y++) {
        for (let x = 0; x < gridCols; x++) {
            pieces.push({ x: -x * pieceWidth, y: -y * pieceHeight });
        }
    }

    originalPositions = pieces.map(piece => ({
        x: piece.x * scale,
        y: piece.y * scale
    }));

    const indices = Array.from({ length: PUZZLE_PIECES }, (_, i) => i);
    shuffleArray(indices);

    pieces.forEach((piece, i) => {
        const div = document.createElement('div');
        div.className = 'puzzle-piece';
        div.draggable = true;
        div.style.backgroundImage = `url(${currentImage})`;
        div.style.backgroundSize = `${imageWidth * scale}px ${imageHeight * scale}px`;
        const shuffledIndex = indices[i];
        div.style.backgroundPosition = `${pieces[shuffledIndex].x * scale}px ${pieces[shuffledIndex].y * scale}px`;
        div.addEventListener('dragstart', dragStart);
        div.addEventListener('dragover', dragOver);
        div.addEventListener('dragend', dragEnd);
        div.addEventListener('drop', drop);
        if (isPuzzleSolved()) {
            div.style.border = 'none';
        }
        puzzleContainer.appendChild(div);
    });
}

let draggedPiece = null;

function dragStart(e) {
    draggedPiece = e.target;
    draggedPiece.classList.add('dragging');
    e.dataTransfer.setData('text/plain', draggedPiece.style.backgroundPosition);
}

function dragOver(e) {
    e.preventDefault();
}

function dragEnd(e) {
    e.target.classList.remove('dragging');
}

function drop(e) {
    e.preventDefault();
    const dropTarget = e.target;
    if (dropTarget.className === 'puzzle-piece' && dropTarget !== draggedPiece) {
        const tempPos = draggedPiece.style.backgroundPosition;
        draggedPiece.style.backgroundPosition = dropTarget.style.backgroundPosition;
        dropTarget.style.backgroundPosition = tempPos;

        if (isPuzzleSolved()) {
            showCompletionAnimation();
        }
    }
}

function isPuzzleSolved() {
    const pieces = Array.from(puzzleContainer.children);
    return pieces.every((piece, index) => {
        const [x, y] = piece.style.backgroundPosition.split(' ').map(val => parseFloat(val));
        const origX = originalPositions[index].x;
        const origY = originalPositions[index].y;
        return Math.abs(origX - x) < 0.1 && Math.abs(origY - y) < 0.1;
    });
}

function showCompletionAnimation() {
    isPuzzleCompleted = true;
    shootConfetti();
    const completeDiv = document.createElement('div');
    completeDiv.className = 'puzzle-complete';
    completeDiv.innerHTML = `
        <button id="save-puzzle">Save</button>
        <button id="next-puzzle">Next</button>
    `;
    puzzleContainer.appendChild(completeDiv);

    if (isPuzzleCompleted) {
        const pieces = puzzleContainer.getElementsByClassName('puzzle-piece');
        for (let piece of pieces) {
            piece.style.border = 'none';
        }
    }

    setTimeout(() => {
        completeDiv.style.opacity = '1';
    }, 3000);

    document.getElementById('save-puzzle').addEventListener('click', savePuzzle);
    document.getElementById('next-puzzle').addEventListener('click', () => {
        puzzleContainer.innerHTML = '';
        loadNextImage();
    });
}

function savePuzzle() {
    const link = document.createElement('a');
    link.href = currentImage;
    link.download = originalImageName;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
}

document.getElementById('next-button')?.addEventListener('click', () => {
    puzzleContainer.innerHTML = '';
    loadNextImage();
});

loadNextImage();

window.addEventListener('resize', () => {
    if (currentImage && !isPuzzleCompleted) {
        startPuzzle();
    }
});